import styled from 'styled-components'

export const Slider = styled.section`
  position: relative;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
`

export const Image = styled.img`
	  width: 1000px;
	  height: 600px;
    border-radius: 10px;
`
